import React from 'react'
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import Stack from "@mui/material/Stack";
import { Typography } from '@mui/material';

export default function Education() {
  return (
    <div>
      <Stack direction="row" spacing={2} sx={{ height: "500px", ml: 5 }}>
            <div className="list">
              <Box
                sx={{
                  bgcolor: "#b5b5b5",
                  borderRadius: 2,
                  height: 250,
                }}
              >
                <div class="container">
                  <div class="circle1"></div>
                  <div class="circle2"></div>
                  <div class="circle3"></div>
                </div>
                <Paper
                  elevation={3}
                  sx={{
                    bgcolor: "white",
                    borderRadius: 1,
                    width: 800,
                    height: 500,
                    fontSize: 24,
                  }}
                >
                  <br />
                  <Typography variant="h2"> Profile </Typography>
                  <Typography display="block" variant="p">


                  </Typography>
                </Paper>
              </Box>
            </div>
      </Stack>

      <Stack direction="row" spacing={2} sx={{ height: "500px", ml: 110}}>
            <div className="second box">
              <Box
                sx={{
                  bgcolor: "#b5b5b5",
                  borderRadius: 2,
                  height: 250,
                }}
              >
                <div class="container">
                  <div class="circle1"></div>
                  <div class="circle2"></div>
                  <div class="circle3"></div>
                </div>
                <Paper
                  elevation={3}
                  sx={{
                    bgcolor: "white",
                    borderRadius: 1,
                    width: 800,
                    height: 400,
                    fontSize: 24,
                  }}
                >
                  <br />
                  <Typography variant="h2"> Experience </Typography>
                  <Typography variant="p">
                    Purdue University, Bachelor of Science in Data Science{" "}
                  </Typography>
                </Paper>
              </Box>
            </div>
      </Stack>
    </div>
  )
}
